import React from 'react';
import { View, Text, Image, StyleSheet } from 'react-native';

const servOneData = [
    { img: require("../../../assets/hd.png"), tite: "Haircut & Styling" },
    { img: require("../../../assets/hd.png"), tite: "Haircut & Styling" },
    { img: require("../../../assets/hd.png"), tite: "Haircut & Styling" },
    { img: require("../../../assets/hd.png"), tite: "Haircut & Styling" },
    { img: require("../../../assets/hd.png"), tite: "Haircut & Styling" },
]

const ServiceOneMiddle = () => {
    return (
        <View style={styles.l_middle}>
            <View style={styles.l_miidle_box}>
                <View style={styles.box}>One</View>
                <View style={styles.box2}>One</View>
                <View>Two</View>
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    l_middle: {
        width: '100vw',
        height: '100vh',
        backgroundColor: "#000",
        display: 'inline-block',
        top: 118
    }, l_miidle_box: {
        width: '95vw',
        height: '50vh',
        backgroundColor: "#909090",
        margin: 'auto',
        justifyContent: 'space-between',
        flexDirection: 'row',
        flexWrap: 'wrap',
        padding: '20px'
    },
     box: {
        width: '200px',
        height: '300px',
        backgroundColor: "#000"
    }
})

export default ServiceOneMiddle;
